(1, 1, 'Aplikasi E-commerce untuk Farmasi Besar', 'technology', , 'Kami membuat aplikasi yang menghubungkan penyedia stok obat-obatan maupun alat kesehatan dengan apotek-apotek hingga rumah sakit.', 'Ada sebuah artikel yang pernah saya baca menjelaskan tentang e-commerce di dunia kesehatan lebih kuat di lingkup B2B yaitu business to business. Hal itu mendorong saya untuk membuat suatu aplikasi e-commerce untuk perdagangan besar farmasi, yang mana menghubungkan antara Distributor penyedia obat-obatan dan alat-alat kesehatan dengan apotek-apotek, toko obat, maupun rumah sakit yang membutuhkan stok tertentu. Seperti yang kita tahu, penggunaan obat-obatan dan alat-alat kesehatan terus bertambah dan sangat di butuhkan kapanpun. Hal ini mendorong setiap apotek atau toko obat bahkan rumah sakit, untuk selalu menyetok barang dan berusaha agar barang tidak kosong di toko mereka. Namun terkadang pemesanan yang terlalu banyak aturan menjadi hambatan, belum lagi proses pengiriman. Akan sangat menguntungkan jika ada aplikasi e-commerce yang menyediakan data barang-barang yang mereka butuhkan, sehingga mereka tahu harus memesan dimana. Hal ini akan mempercepat segala proses setelahnya.', 'Kota Bandung', '2019-04-01', '2019-10-01', 'Programmer', 10, 'yes', 'Accepted');
INSERT INTO `project` (`id_project`, `id_user`, `judul_project`, `kategori`, `upload_image`, `short_desc`, `deskripsi`, `lokasi`, `start_date`, `end_date`, `bidang_keahlian`, `max_user`, `popularity`, `admin_check`) VALUES
(2, 5, 'Dansing with Goyi Pipi and Friends', 'music', , 'Project ini berupa konten tayangan video dance and sing bersama karakter fiktif Goyi Pipi dan teman-temannya untuk segmen anak-anak (3-8 tahun) dengan dipandu oleh 2 hosts dan maskot karakter fiktif.', '1. Anak-anak saat ini dimanjakan dengan kehadiran gadget yang membuat mereka selalu fokus di depan layar gadget, malas bergerak dan kurang berinteraksi serta bersosialisasi dengan anggota keluarga yang lainnya bahkan lingkungannya. 2. Konten anak-anak yang mendidik sekaligus menghibur plus bisa membangun emotional bonding dengan orangtua melalui ajakan anak-anak untuk aktif bermain dan bergerak bersama orangtua sangat kurang 3. Larangan penggunaan gadget kepada anak-anak memang tepat, namun tidak berarti meniadakannya sama sekali. Dibutuhkan inovasi dan kreatifitas yang bisa menjembatani permasalahan tersebut sebagai sebuah solusi yang tepat dan efektif', 'Kota Surabaya', '2019-04-01', '2019-10-24', 'Animator', 1, 'no', 'Accepted');

